import DeleteIcon from '@mui/icons-material/Delete';
import "./Content.css"

function Content() {
  const [Data, SetData] = useState("")
  const [ArrData, SetArrData] = useState([])
  
  function LogFile(){
    if(!Data){

    }else{
    SetArrData([...ArrData, Data])
    SetData("")
    }
  }
  return (
    <div className='Contents'>
      <input type='text' className='SearchBar' value={Data} onChange={(x)=>SetData(x.target.value)} placeholder='To do Tasks....'></input>
      <button className='task-button' onClick={LogFile}>Create</button>
      <div className='AllTasksContent'>
        <div className='TasksContent'>
          <p className='Tasks'>This is a task</p>
          <button className='DeleteButton'><DeleteIcon sx={{ fontSize: 20 }} /></button>
        </div>
      </div>
    </div>
  )
}

export default Content
